import banner_img from './assets/homedisplay.png';

const banner = () => {
    return(
        <div className='row banner'>
            <img class="homedisplay" src={banner_img}/>
        </div>
    );

}

const Home = () => {

    return(
    <>
        <banner />
    </>
    );
    
}
